import React, { useState } from 'react';


export function Home(){
    const [img,setImg] = useState(0);
    const imagenes = ["https://i.ibb.co/FXdhvmP/cortes-de-carne-1024x536.png",
                        "https://i.ibb.co/xSvxF4s/Tipos-de-corte-de-carne.jpg",
                        "https://i.ibb.co/CskLrYN/1405529867.jpg"];
    return(

        <div>
            {img === 0 && <img className="home-imagenes" src={imagenes[0]} alt=""/>}
            
            {img === 1 && <img className="home-imagenes" src={imagenes[1]} alt=""/>}
            
            {img === 2 && <img className="home-imagenes" src={imagenes[2]} alt=""/>}
            
        </div>
    );
}
